import React from 'react';
import './Footer.css';

function Footer()
{
    return(
        <div id = "__footer">
            <div id = "__footer-title">
                Support
            </div>
            <div id = "__footer-blurb">
                Come check out our social media!: <a>Instagram</a> and <a>Kijiji</a>
                <br />
                <br />
                Have any questions? Don't hesitate to email us at info@musicunbounded.org
            </div>
        </div>
    )
}

export default Footer
